import React from 'react';
import { Button } from 'antd';
import './pay-checkout.styles.css';

const PayCheckOut = () => (
  <div className="pay-container">
    <h2>Order Summary</h2>
    <div>
      <p>Total</p>
      <p>10$</p>
    </div>
    <Button type="primary" style={{ width: '100%' }}>Check Out</Button>
  </div>
);

export default PayCheckOut;
